Director Emir Kusturica and screenwriter David Atkins crafted this absurdist comedy in which Johnny Depp plays Axel Blackmer, who lives in New York State and is obsessed with fish. He tags fish and monitors their habits for a living, but his greatest curiosity is when and how they dream. Axel's uncle, Leo Sweetie (Jerry Lewis) would prefer Axel take over the family business, a Cadillac dealership in Tucson, Arizona; against his better judgment, Axel drives from New York to Arizona to check out the lot and attend Leo's wedding to Millie (Paulina Porizkova), a woman who is hoping that marriage will keep her from crying all the time. While watching the Cadillacs, Leo meets Elaine Stalker (Faye Dunaway), the sexy widow of a wealthy mine owner, and the two strike up a romance, while Elaine's daughter Grace (Lili Taylor) wanders through her mother's home playing &quot;Besame Mucho&quot; on the accordion to her pet turtles.

